3	participatory_processes	2	{"en": "<p>A <strong>participatory process</strong> is a sequence of participatory activities (e.g. first filling out a survey, then making proposals, discussing them in face-to-face or virtual meetings, and finally prioritizing them) with the aim of defining and making a decision on a specific topic.</p><p>Examples of participatory processes are: a process of electing committee members (where candidatures are first presented, then debated and finally a candidacy is chosen), participatory budgets (where proposals are made, valued economically and voted on with the money available), a strategic planning process, the collaborative drafting of a regulation or norm, the design of an urban space or the production of a public policy plan.</p>"}
4	assemblies	2	{"en": "<p>An <strong>assembly</strong> is a group of members of an organization who meet periodically to make decisions about a specific area or scope of the organization.</p><p>Assemblies hold meetings, some are private and some are open. If they are open, it is possible to participate in them (for example: attending if the capacity allows it, adding points to the agenda, or commenting on the proposals and decisions taken by this organ).</p><p>Examples: A general assembly (which meets once a year to define the organisation's main lines of action as well as its executive bodies by vote), an equality advisory council (which meets every two months to make proposals on how to improve gender relations in the organisation), an evaluation commission (which meets every month to monitor a process) or a guarantee body (which collects incidents, abuses or proposals to improve decision-making procedures) are all examples of assemblies.</p>"}
5	initiatives	2	{"en": "<p>Una&nbsp;<strong>petizione</strong>&nbsp; una richiesta ad un'autorit - generalmente governativa - o a un ente pubblico. Nel linguaggio colloquiale, una petizione  un documento sottoscritto da uno o pi individui e indirizzato a un ente pubblico o privato.</p><p>In base alle finalit,  possibile classificare le petizioni come:</p><ul><li><em>precettistiche</em>, se invogliano il legislatore ad approvare delle norme che colmino un vuoto legislativo (<em>vacatio</em>)</li><li>di&nbsp;<em>sensibilizzazione</em>, se hanno lo scopo di focalizzare l'interesse del destinatario su una particolare tematica</li><li><em>abrogative</em>, se invogliano il legislatore ad abrogare una determinata norma giuridica</li></ul><p>Per una petizione non  necessaria l'autentica di firma con la registrazione degli estremi di un documento d'identit.</p>"}
