3	bilancioPartecipativo2022		2	2022-03-17 15:45:05.985145	2022-03-17 15:46:24.307766	{"en": "", "it": "Bilancio Partecipativo 2022"}	{"en": "", "it": "Il Bilancio Partecipativo promuove la partecipazione attiva dei cittadini alla vita politica e sociale considerandola un valore fondamentale in cui questa Amministrazione crede fermamente.  Uno strumento attraverso il quale si costruisce un rapporto di fiducia tra istituzioni e cittadini, non delegando a questi ultimi la responsabilit di governo ma stimolando in essi una partecipazione concreta in un ambito, quello di bilancio, solitamente gestito esclusivamente dalla parte di rappresentanza politica."}	{"en": "", "it": "<p>La&nbsp;<strong>Partecipazione</strong>&nbsp; un tema importante per questa Amministrazione, che sta realizzando attraverso&nbsp;<strong>strumenti diversi</strong>: le assemblee pubbliche, lascolto attivo e le risposte ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani&nbsp;<em>R-Estate Attivi</em>, il&nbsp;<em>Volontariato Civico</em>, il&nbsp;<em>Bilancio Partecipato</em>&nbsp;e il&nbsp;<em>Bilancio Partecipativo</em>. Questi ultimi due esempi sono una dimostrazione concreta della&nbsp;<strong>volont di coinvolgere i cittadini</strong>&nbsp;nelle scelte decisionali dellAmministrazione.</p>"}	{"en": "", "it": "<p>La&nbsp;<strong>Partecipazione</strong>&nbsp; un tema importante per questa Amministrazione, che sta realizzando attraverso&nbsp;<strong>strumenti diversi</strong>: le assemblee pubbliche, lascolto attivo e le risposte ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani&nbsp;<em>R-Estate Attivi</em>, il&nbsp;<em>Volontariato Civico</em>, il&nbsp;<em>Bilancio Partecipato</em>&nbsp;e il&nbsp;<em>Bilancio Partecipativo</em>. Questi ultimi due esempi sono una dimostrazione concreta della&nbsp;<strong>volont di coinvolgere i cittadini</strong>&nbsp;nelle scelte decisionali dellAmministrazione.</p><p>Il Bilancio Partecipativo, che ha richiesto un grande investimento di energie, gi nella fase di pianificazione avviata in primavera, questanno coinvolger<strong>&nbsp;tutto il territorio di Rivalta</strong>; il 3 settembre  partito nel quartiere di Tetti Francesi e a seguire nel Centro e nelle altre frazioni. Sono previsti 6 incontri per ciascuno dei quattro quartieri (Tetti Francesi, Centro, Gerbole e Pasta).</p>"}	\N	\N	f	2022-03-17 15:46:24.226622	{"en": "", "it": "Comune"}	2022-12-31	{"en": "", "it": "Torino"}	{"en": "", "it": "Torino"}	{"en": "", "it": "Cittadini residenti a Torino"}	{"en": "", "it": "Progetti da attuare con bilancio partecipativo 2022"}	{"en": "", "it": "Votazioni"}	\N	\N	t	{"en": "", "it": ""}	f	2022-01-01	f	TO-PART-2022-03-3	\N	\N	f	0	1
