3587	Bilancio Partecipativo 2022	Il Bilancio Partecipativo promuove la partecipazione attiva dei cittadini alla vita politica e sociale considerandola un valore fondamentale in cui questa Amministrazione crede fermamente.  Uno strumento attraverso il quale si costruisce un rapporto di fiducia tra istituzioni e cittadini, non delegando a questi ultimi la responsabilita di governo ma stimolando in essi una partecipazione concreta in un ambito, quello di bilancio, solitamente gestito esclusivamente dalla parte di rappresentanza politica.	La?Partecipazione?e un tema importante per questa Amministrazione, che sta realizzando attraverso?strumenti diversi: le assemblee pubbliche, l?ascolto attivo e le risposte ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani?R-Estate Attivi, il?Volontariato Civico, il?Bilancio Partecipato?e il?Bilancio Partecipativo. Questi ultimi due esempi sono una dimostrazione concreta della?volonta di coinvolgere i cittadini?nelle scelte decisionali dell?Amministrazione.	La?Partecipazione?e un tema importante per questa Amministrazione, che sta realizzando attraverso?strumenti diversi: le assemblee pubbliche, l?ascolto attivo e le risposte ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani?R-Estate Attivi, il?Volontariato Civico, il?Bilancio Partecipato?e il?Bilancio Partecipativo. Questi ultimi due esempi sono una dimostrazione concreta della?volonta di coinvolgere i cittadini?nelle scelte decisionali dell?Amministrazione.Il Bilancio Partecipativo, che ha richiesto un grande investimento di energie, gia nella fase di pianificazione avviata in primavera, quest?anno coinvolgera?tutto il territorio di Rivalta; il 3 settembre e partito nel quartiere di Tetti Francesi e a seguire nel Centro e nelle altre frazioni. Sono previsti 6 incontri per ciascuno dei quattro quartieri (Tetti Francesi, Centro, Gerbole e Pasta).	it	2022-03-17 15:46:24.226622	\N	Decidim::ParticipatoryProcess	3	2	Decidim::ParticipatoryP