6	{"en": "What can I do in Torino?"}	help	{"en": "<p>In Torino you can participate and decide on different topics, through the spaces you see in the top menu: Processes, Assemblies, Initiatives, Consultations.</p> <p>Within each one you will find different options to participate: make proposals - individually or with other people-, take part in debates, prioritize projects to implement, attend face-to-face meetings and other actions.</p>\\n"}	2	2022-03-17 14:45:24.168526	2022-03-17 14:45:24.168526	0	f	2	f
7	{"en": "What is a participatory process?"}	participatory_processes	{"en": "<p>A <strong>participatory process</strong> is a sequence of participatory activities (e.g. first filling out a survey, then making proposals, discussing them in face-to-face or virtual meetings, and finally prioritizing them) with the aim of defining and making a decision on a specific topic.</p> <p>Examples of participatory processes are: a process of electing committee members (where candidatures are first presented, then debated and finally a candidacy is chosen), participatory budgets (where proposals are made, valued economically and voted on with the money available), a strategic planning process, the collaborative drafting of a regulation or norm, the design of an urban space or the production of a public policy plan.</p>\\n"}	2	2022-03-17 14:45:24.201644	2022-03-17 14:45:24.201644	\N	f	2	f
8	{"en": "What are assemblies?"}	assemblies	{"en": "<p>An <strong>assembly</strong> is a group of members of an organization who meet periodically to make decisions about a specific area or scope of the organization.</p> <p>Assemblies hold meetings, some are private and some are open. If they are open, it is possible to participate in them (for example: attending if the capacity allows it, adding points to the agenda, or commenting on the proposals and decisions taken by this organ).</p> <p>Examples: A general assembly (which meets once a year to define the organisation's main lines of action as well as its executive bodies by vote), an equality advisory council (which meets every two months to make proposals on how to improve gender relations in the organisation), an evaluation commission (which meets every month to monitor a process) or a guarantee body (which collects incidents, abuses or proposals to improve decision-making procedures) are all examples of assemblies.</p>\\n"}	2	2022-03-17 14:45:24.262117	2022-03-17 14:45:24.262117	\N	f	2	f
5	{"en": "Default title for terms-and-conditions"}	terms-and-conditions	{"en": "<p>Please add meaningful content to the terms-and-conditions static page on the admin dashboard.</p>"}	2	2022-03-17 14:45:24.071435	2022-03-17 15:06:38.078966	\N	f	\N	t
