62	Decidim::StaticPage	2	create	\N	\N	2022-03-17 14:36:15.683728	---\nid:\n- \n- 2\ntitle:\n- \n- '{"en":"What can I do in Gleichner Group?","ca":"Qu puc fer a Gleichner Group?","es":"Qu\n  puedo hacer en Gleichner Group?"}'\nslug:\n- \n- help\ncontent:\n- \n- '{"en":"\\u003cp\\u003eIn Gleichner Group you can participate and decide on different\n  topics, through the spaces you see in the top menu: Processes, Assemblies, Initiatives,\n  Consultations.\\u003c/p\\u003e \\u003cp\\u003eWithin each one you will find different\n  options to participate: make proposals - individually or with other people-, take\n  part in debates, prioritize projects to implement, attend face-to-face meetings\n  and other actions.\\u003c/p\\u003e\\n","ca":"\\u003cp\\u003eA Gleichner Group pots participar\n  i decidir sobre diferents temes, a travs dels espais que veus al men superior:\n  Processos, Assemblees, Iniciatives, Consultes.\\u003c/p\\u003e \\u003cp\\u003eDins de\n  cada un trobars diferents opcions per participar: fer propostes - a nivell individual\n  o amb altres persones -, prendre part en debats, prioritzar projectes a executar,\n  assistir a trobades presencials i altres accions.\\u003c/p\\u003e\\n","es":"\\u003cp\\u003eEn\n  Gleichner Group puedes participar y decidir sobre diferentes temas, a travs de\n  los espacios que ves en el men superior: Procesos, Asambleas, Iniciativas, Consultas.\\u003c/p\\u003e\n  \\u003cp\\u003eDentro de cada uno encontrars diferentes opciones para participar:\n  hacer propuestas (individualmente o con otras personas), tomar parte en debates,\n  priorizar proyectos a ejecutar, asistir a encuentros presenciales y otras acciones.\\u003c/p\\u003e\\n"}'\ndecidim_organization_id:\n- \n- 1\ncreated_at:\n- \n- &1 2022-03-17 14:36:15.683728000 Z\nupdated_at:\n- \n- *1\nweight:\n- \n- 0\ntopic_id:\n- \n- 1\n
