63	Decidim::StaticPage	3	create	\N	\N	2022-03-17 14:36:15.697391	---\nid:\n- \n- 3\ntitle:\n- \n- '{"en":"What is a participatory process?","ca":"Qu s un procs participatiu?","es":"Qu\n  es un proceso participativo?"}'\nslug:\n- \n- participatory_processes\ncontent:\n- \n- '{"en":"\\u003cp\\u003eA \\u003cstrong\\u003eparticipatory process\\u003c/strong\\u003e\n  is a sequence of participatory activities (e.g. first filling out a survey, then\n  making proposals, discussing them in face-to-face or virtual meetings, and finally\n  prioritizing them) with the aim of defining and making a decision on a specific\n  topic.\\u003c/p\\u003e \\u003cp\\u003eExamples of participatory processes are: a process\n  of electing committee members (where candidatures are first presented, then debated\n  and finally a candidacy is chosen), participatory budgets (where proposals are made,\n  valued economically and voted on with the money available), a strategic planning\n  process, the collaborative drafting of a regulation or norm, the design of an urban\n  space or the production of a public policy plan.\\u003c/p\\u003e\\n","ca":"\\u003cp\\u003eUn\n  \\u003cstrong\\u003eprocs participatiu\\u003c/strong\\u003e s una seqncia d''activitats\n  participatives (p.e. primer omplir una enquesta, desprs realitzar propostes, debatre-les\n  en trobades presencials o virtuals, i finalment prioritzar-les) amb l''objectiu\n  de definir y prendre una decisi sobre un tema especfic.\\u003c/p\\u003e \\u003cp\\u003eExemples\n  de processos participatius sn: un procs d''elecci de les membres d''un comit\n  (on primer es presenten unes candidatures, desprs es debat i finalment s''escull\n  una candidatura), pressupostos participatius (on es realitzen propostes, es valoren\n  econmicament i es voten amb el pressupost disponible), un procs de planificaci\n  estratgica, la redacci collaborativa d''un reglament o norma, el disseny d''un\n  espai urb o la producci d''un pla de poltiques pbliques.\\u003c/p\\u003e\\n","es":"\\u003cp\\u003eUn\n  \\u003cstrong\\u003eproceso participativo\\u003c/strong\\u003e es una secuencia de actividades\n  participativas (p.e. primero rellenar una encuesta, luego realizar propuestas, debatirlas\n  en encuentros presenciales o virtuales, y finalmente priorizarlas) con el objetivo\n  de definir y tomar una decisin sobre un tema especfico.\\u003c/p\\u003e \\u003cp\\u003eEjemplos\n  de procesos participativos son: un proceso de eleccin de los miembros de un comit\n  (donde primero se presentan unas candidaturas, luego se debate y finalmente se elige\n  una candidatura), presupuestos participativos (donde se realizan propuestas, se\n  valoran econmicamente y se vota con el dinero disponible), un proceso de planificacin\n  estratgica, la redaccin colaborativa de un reglamento o norma, el diseo de un\n  espacio urbano o la produccin de un plan de polticas pblicas.\\u003c/p\\u003e\\n"}'\ndecidim_organization_id:\n- \n- 1\ncreated_at:\n- \n- &1 2022-03-17 14:36:15.697391500 Z\nupdated_at:\n- \n- *1\ntopic_id:\n- \n- 1\n
64	Decidim::StaticPage	4	create	\N	\N	2022-03-17 14:36:15.728321	---\nid:\n- \n- 4\ntitle:\n- \n- '{"en":"What are assemblies?","ca":"Qu sn les assemblees?","es":"Qu son las\n  asambleas?"}'\nslug:\n- \n- assemblies\ncontent:\n- \n- '{"en":"\\u003cp\\u003eAn \\u003cstrong\\u003eassembly\\u003c/strong\\u003e is a group\n  of members of an organization who meet periodically to make decisions about a specific\n  area or scope of the organization.\\u003c/p\\u003e \\u003cp\\u003eAssemblies hold meetings,\n  some are private and some are open. If they are open, it is possible to participate\n  in them (for example: attending if the capacity allows it, adding points to the\n  agenda, or commenting on the proposals and decisions taken by this organ).\\u003c/p\\u003e\n  \\u003cp\\u003eExamples: A general assembly (which meets once a year to define the\n  organisation''s main lines of action as well as its executive bodies by vote), an\n  equality advisory council (which meets every two months to make proposals on how\n  to improve gender relations in the organisation), an evaluation commission (which\n  meets every month to monitor a process) or a guarantee body (which collects incidents,\n  abuses or proposals to improve decision-making procedures) are all examples of assemblies.\\u003c/p\\u003e\\n","ca":"\\u003cp\\u003eUna\n  \\u003cstrong\\u003eassemblea\\u003c/strong\\u003e s un grup format per membres d''una\n  organitzaci que es reuneixen peridicament per prendre decisions sobre un mbit\n  o rea especfica de la mateixa.\\u003c/p\\u003e \\u003cp\\u003eLes assemblees realitzen\n  trobades, algunes sn privades i altres sn obertes. Si sn obertes shi pot participar\n  (per exemple: assistint si l''aforament ho permet, afegint punts a l''ordre del\n  dia, o comentant les propostes i decisions preses per aquest rgan).\\u003c/p\\u003e\n  \\u003cp\\u003eExemples: Una assemblea general (que es reuneix un cop l''any per definir\n  les lnies principals d''acci de l''organitzaci aix com als seus rgans executius\n  per votaci), una consell assessor d''igualtat (que es reuneix cada dos mesos per\n  fer propostes de com millorar les relacions de gnere en l''organitzaci), una comissi\n  d''avaluaci (que es reuneix cada mes per fer el seguiment d''un procs) o una rgan\n  de garanties (que recull les incidncies, abusos o propostes de millora dels procediments\n  de presa de decisions) sn tot exemples d''assemblees.\\u003c/p\\u003e\\n","es":"\\u003cp\\u003eUna\n  \\u003cstrong\\u003easamblea\\u003c/strong\\u003e es un grupo formado por miembros de\n  una organizacin que se renen peridicamente para tomar decisiones sobre un mbito\n  o rea especfica de la misma.\\u003c/p\\u003e\\u003cp\\u003eLas asambleas realizan\n  encuentros, algunos son privados y otros son abiertos. Si son abiertos se puede\n  participar en ellos (por ejemplo: asistiendo si el aforo lo permite, aadiendo puntos\n  al orden del da, o comentando las propuestas y decisiones tomadas por dicho rgano).\\u003c/p\\u003e\n  \\u003cp\\u003eEjemplos: Una asamblea general (que se rene una vez al ao para definir\n  las lneas principales de accin de la organizacin as como para escojer a sus\n  rganos ejecutivos por votacin), una consejo asesor de igualdad (que se rene cada\n  dos meses para realizar propuestas de cmo mejorar las relaciones de gnero en la\n  organizacin), una comisin de evaluacin (que se rene cada mes para realizar el\n  seguimiento de un proceso) o un rgano de garantas (que recoge las incidencias,\n  abusos o propuestas de mejora de los procedimientos de toma de decisiones) son todo\n  ejemplos de asambleas.\\u003c/p\\u003e\\n"}'\ndecidim_organization_id:\n- \n- 1\ncreated_at:\n- \n- &1 2022-03-17 14:36:15.728321100 Z\nupdated_at:\n- \n- *1\ntopic_id:\n- \n- 1\n
