1893	Decidim::ParticipatoryProcess	3	create	\N	\N	2022-03-17 15:45:05.985145	---\nid:\n- \n- 3\nslug:\n- \n- bilancioPartecipativo2022\nhashtag:\n- \n- ''\ndecidim_organization_id:\n- \n- 2\ncreated_at:\n- \n- &1 2022-03-17 15:45:05.985145100 Z\nupdated_at:\n- \n- *1\ntitle:\n- \n- '{"it":"Bilancio Partecipativo 2022","en":""}'\nsubtitle:\n- \n- '{"it":"Il Bilancio Partecipativo promuove la partecipazione attiva dei cittadini\n  alla vita politica e sociale considerandola un valore fondamentale in cui questa\n  Amministrazione crede fermamente.  Uno strumento attraverso il quale si costruisce\n  un rapporto di fiducia tra istituzioni e cittadini, non delegando a questi ultimi\n  la responsabilit di governo ma stimolando in essi una partecipazione concreta in\n  un ambito, quello di bilancio, solitamente gestito esclusivamente dalla parte di\n  rappresentanza politica.","en":""}'\nshort_description:\n- \n- '{"it":"\\u003cp\\u003eLa\\u0026nbsp;\\u003cstrong\\u003ePartecipazione\\u003c/strong\\u003e\\u0026nbsp;\n  un tema importante per questa Amministrazione, che sta realizzando attraverso\\u0026nbsp;\\u003cstrong\\u003estrumenti\n  diversi\\u003c/strong\\u003e: le assemblee pubbliche, lascolto attivo e le risposte\n  ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani\\u0026nbsp;\\u003cem\\u003eR-Estate\n  Attivi\\u003c/em\\u003e, il\\u0026nbsp;\\u003cem\\u003eVolontariato Civico\\u003c/em\\u003e,\n  il\\u0026nbsp;\\u003cem\\u003eBilancio Partecipato\\u003c/em\\u003e\\u0026nbsp;e il\\u0026nbsp;\\u003cem\\u003eBilancio\n  Partecipativo\\u003c/em\\u003e. Questi ultimi due esempi sono una dimostrazione concreta\n  della\\u0026nbsp;\\u003cstrong\\u003evolont di coinvolgere i cittadini\\u003c/strong\\u003e\\u0026nbsp;nelle\n  scelte decisionali dellAmministrazione.\\u003c/p\\u003e","en":""}'\ndescription:\n- \n- '{"it":"\\u003cp\\u003eLa\\u0026nbsp;\\u003cstrong\\u003ePartecipazione\\u003c/strong\\u003e\\u0026nbsp;\n  un tema importante per questa Amministrazione, che sta realizzando attraverso\\u0026nbsp;\\u003cstrong\\u003estrumenti\n  diversi\\u003c/strong\\u003e: le assemblee pubbliche, lascolto attivo e le risposte\n  ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani\\u0026nbsp;\\u003cem\\u003eR-Estate\n  Attivi\\u003c/em\\u003e, il\\u0026nbsp;\\u003cem\\u003eVolontariato Civico\\u003c/em\\u003e,\n  il\\u0026nbsp;\\u003cem\\u003eBilancio Partecipato\\u003c/em\\u003e\\u0026nbsp;e il\\u0026nbsp;\\u003cem\\u003eBilancio\n  Partecipativo\\u003c/em\\u003e. Questi ultimi due esempi sono una dimostrazione concreta\n  della\\u0026nbsp;\\u003cstrong\\u003evolont di coinvolgere i cittadini\\u003c/strong\\u003e\\u0026nbsp;nelle\n  scelte decisionali dellAmministrazione.\\u003c/p\\u003e\\u003cp\\u003eIl Bilancio Partecipativo,\n  che ha richiesto un grande investimento di energie, gi nella fase di pianificazione\n  avviata in primavera, questanno coinvolger\\u003cstrong\\u003e\\u0026nbsp;tutto il\n  territorio di Rivalta\\u003c/strong\\u003e; il 3 settembre  partito nel quartiere\n  di Tetti Francesi e a seguire nel Centro e nelle altre frazioni. Sono previsti 6\n  incontri per ciascuno dei quattro quartieri (Tetti Francesi, Centro, Gerbole e Pasta).\\u003c/p\\u003e","en":""}'\ndeveloper_group:\n- \n- '{"it":"Comune","en":""}'\nend_date:\n- \n- 2022-12-31\nmeta_scope:\n- \n- '{"it":"Torino","en":""}'\nlocal_area:\n- \n- '{"it":"Torino","en":""}'\ntarget:\n- \n- '{"it":"Cittadini residenti a Torino","en":""}'\nparticipatory_scope:\n- \n- '{"it":"Progetti da attuare con bilancio partecipativo 2022","en":""}'\nparticipatory_structure:\n- \n- '{"it":"Votazioni","en":""}'\nscopes_enabled:\n- true\n- false\nstart_date:\n- \n- 2022-01-01\nweight:\n- 1\n- 0\n
