1895	Decidim::ParticipatoryProcess	3	update	\N	{"id": 3, "slug": "bilancioPartecipativo2022", "title": {"en": "", "it": "Bilancio Partecipativo 2022"}, "target": {"en": "", "it": "Cittadini residenti a Torino"}, "weight": 0, "hashtag": "", "end_date": "2022-12-31", "promoted": false, "subtitle": {"en": "", "it": "Il Bilancio Partecipativo promuove la partecipazione attiva dei cittadini alla vita politica e sociale considerandola un valore fondamentale in cui questa Amministrazione crede fermamente.  Uno strumento attraverso il quale si costruisce un rapporto di fiducia tra istituzioni e cittadini, non delegando a questi ultimi la responsabilit di governo ma stimolando in essi una partecipazione concreta in un ambito, quello di bilancio, solitamente gestito esclusivamente dalla parte di rappresentanza politica."}, "reference": "TO-PART-2022-03-3", "created_at": "2022-03-17T15:45:05.985Z", "hero_image": null, "local_area": {"en": "", "it": "Torino"}, "meta_scope": {"en": "", "it": "Torino"}, "start_date": "2022-01-01", "updated_at": "2022-03-17T15:45:05.985Z", "description": {"en": "", "it": "<p>La&nbsp;<strong>Partecipazione</strong>&nbsp; un tema importante per questa Amministrazione, che sta realizzando attraverso&nbsp;<strong>strumenti diversi</strong>: le assemblee pubbliche, lascolto attivo e le risposte ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani&nbsp;<em>R-Estate Attivi</em>, il&nbsp;<em>Volontariato Civico</em>, il&nbsp;<em>Bilancio Partecipato</em>&nbsp;e il&nbsp;<em>Bilancio Partecipativo</em>. Questi ultimi due esempi sono una dimostrazione concreta della&nbsp;<strong>volont di coinvolgere i cittadini</strong>&nbsp;nelle scelte decisionali dellAmministrazione.</p><p>Il Bilancio Partecipativo, che ha richiesto un grande investimento di energie, gi nella fase di pianificazione avviata in primavera, questanno coinvolger<strong>&nbsp;tutto il territorio di Rivalta</strong>; il 3 settembre  partito nel quartiere di Tetti Francesi e a seguire nel Centro e nelle altre frazioni. Sono previsti 6 incontri per ciascuno dei quattro quartieri (Tetti Francesi, Centro, Gerbole e Pasta).</p>"}, "announcement": null, "banner_image": null, "published_at": null, "show_metrics": true, "follows_count": 1, "private_space": false, "scopes_enabled": false, "decidim_area_id": null, "developer_group": {"en": "", "it": "Comune"}, "show_statistics": true, "decidim_scope_id": null, "short_description": {"en": "", "it": "<p>La&nbsp;<strong>Partecipazione</strong>&nbsp; un tema importante per questa Amministrazione, che sta realizzando attraverso&nbsp;<strong>strumenti diversi</strong>: le assemblee pubbliche, lascolto attivo e le risposte ai cittadini che incontriamo e/o che ci scrivono, il progetto per i giovani&nbsp;<em>R-Estate Attivi</em>, il&nbsp;<em>Volontariato Civico</em>, il&nbsp;<em>Bilancio Partecipato</em>&nbsp;e il&nbsp;<em>Bilancio Partecipativo</em>. Questi ultimi due esempi sono una dimostrazione concreta della&nbsp;<strong>volont di coinvolgere i cittadini</strong>&nbsp;nelle scelte decisionali dellAmministrazione.</p>"}, "participatory_scope": {"en": "", "it": "Progetti da attuare con bilancio partecipativo 2022"}, "decidim_scope_type_id": null, "decidim_organization_id": 2, "participatory_structure": {"en": "", "it": "Votazioni"}, "decidim_participatory_process_group_id": null}	2022-03-17 15:46:18.088811	---\nshow_metrics:\n- true\n- false\nupdated_at:\n- 2022-03-17 15:45:05.985145000 Z\n- 2022-03-17 15:46:18.088811000 Z\nannouncement:\n- \n- '{"it":"","en":""}'\n
