1897	Decidim::ParticipatoryProcessStep	3	update	gid://decidim-torino/Decidim::User/227	{"id": 3, "title": {"en": "Introduction", "it": "Introduzione"}, "active": true, "cta_path": null, "cta_text": {}, "end_date": null, "position": 0, "created_at": "2022-03-17T15:45:06.112Z", "start_date": null, "updated_at": "2022-03-17T15:45:06.112Z", "description": null, "decidim_participatory_process_id": 3}	2022-03-17 15:50:28.780888	---\ncta_path:\n- \n- ''\nstart_date:\n- \n- 2022-03-01\nend_date:\n- \n- 2022-03-17\ntitle:\n- '{"en":"Introduction","it":"Introduzione"}'\n- '{"it":"OBIETTIVI E METODO","en":"Introduction"}'\ndescription:\n- \n- '{"it":"\\u003cp\\u003eIl Percorso di Partecipazione ha lobiettivo di discutere e\n  perfezionare le proposte per il territorio contenute nel Piano Aria e Clima.\\u003c/p\\u003e\\u003cp\\u003eIl\n  processo coinvolge cittadini, portatori dinteresse, organizzazioni della societ\n  civile, ordini professionali e soggetti economici in previsione dellapprovazione\n  finale del Piano Aria e Clima da parte del Consiglio Comunale e dell''attuazione\n  effettiva delle azioni del Piano, prevista tra il 2021 e il 2030.\\u003c/p\\u003e","en":""}'\nupdated_at:\n- 2022-03-17 15:45:06.112977000 Z\n- 2022-03-17 15:50:28.780888000 Z\ncta_text:\n- "{}"\n- '{"it":"","en":""}'\n
1898	Decidim::ParticipatoryProcessStep	4	create	gid://decidim-torino/Decidim::User/227	\N	2022-03-17 15:51:04.98275	---\nid:\n- \n- 4\ntitle:\n- \n- '{"it":"FASE 1 | ASCOLTO PRELIMINARE DELLA CITT","en":""}'\ndescription:\n- \n- '{"it":"\\u003cul\\u003e\\u003cli\\u003eviene diffuso un questionario sulla conoscenza\n  e sensibilit dei cittadini rispetto ai cambiamenti climatici e le problematiche\n  ambientali\\u003c/li\\u003e\\u003cli\\u003eviene pubblicato un\\u0026nbsp;\\u003ca href=\\"https://web.comune.milano.it/dseserver/webcity/garecontratti.nsf/WEBAll/4B4163A8C33FB656C12585BD0051FA2B?opendocument\\"\n  rel=\\"noopener noreferrer\\" target=\\"_blank\\"\\u003eavviso pubblico\\u003c/a\\u003e\\u0026nbsp;per\n  l''identificazione degli stakeholder\\u003c/li\\u003e\\u003cli\\u003eviene presentato\n  il rapporto con i\\u0026nbsp;\\u003ca href=\\"https://partecipazione.comune.milano.it/uploads/decidim/attachment/file/8/05102020_Cittadini_e_cambiamenti_climatici_un_indagine_esplorativa.pdf\\"\n  rel=\\"noopener noreferrer\\" target=\\"_blank\\"\\u003erisultati del questionari\\u003c/a\\u003eo\\u003c/li\\u003e\\u003c/ul\\u003e\\u003cp\\u003e\\u003cbr\\u003e\\u003c/p\\u003e","en":""}'\nstart_date:\n- \n- 2022-03-18\nend_date:\n- \n- 2022-03-31\ndecidim_participatory_process_id:\n- \n- 3\ncreated_at:\n- \n- &1 2022-03-17 15:51:04.982750700 Z\nupdated_at:\n- \n- *1\nposition:\n- \n- 1\n
1899	Decidim::ParticipatoryProcessStep	5	create	gid://decidim-torino/Decidim::User/227	\N	2022-03-17 15:51:37.576959	---\nid:\n- \n- 5\ntitle:\n- \n- '{"it":"FASE 2 | ADOZIONE, INCONTRI, PRESENTAZIONE DELLE OSSERVAZIONI","en":""}'\ndescription:\n- \n- '{"it":"\\u003cul\\u003e\\u003cli\\u003eil testo del Piano Aria e Clima viene deliberato\n  dalla Giunta Comunale che lo invia in Consiglio Comunale per proporne l''adozione\\u003c/li\\u003e\\u003cli\\u003ela\n  Giunta Comunale delibera il\\u0026nbsp;\\u003ca href=\\"https://partecipazione.comune.milano.it/uploads/decidim/attachment/file/11/Delibera_Partecipazione_PAC.pdf\\"\n  rel=\\"noopener noreferrer\\" target=\\"_blank\\"\\u003eProcesso Partecipativo\\u003c/a\\u003e\\u0026nbsp;sul\n  Piano Aria e Clima\\u003c/li\\u003e\\u003cli\\u003evengono organizzati\\u0026nbsp;\\u003ca\n  href=\\"https://partecipazione.comune.milano.it/processes/piano-aria-clima/f/17/\\"\n  rel=\\"noopener noreferrer\\" target=\\"_blank\\"\\u003equattro Laboratori tematici di\n  ambito\\u003c/a\\u003e\\u0026nbsp;con gli stakeholder (on-line)\\u003c/li\\u003e\\u003cli\\u003eviene\n  organizzato il\\u0026nbsp;\\u003ca href=\\"https://partecipazione.comune.milano.it/processes/piano-aria-clima/f/17/\\"\n  rel=\\"noopener noreferrer\\" target=\\"_blank\\"\\u003eTavolo dei Cittadini\\u0026nbsp;\\u003c/a\\u003econ\n  un campione selezionato di cittadini in rappresentanza della popolazione di Milano\n  (alla luce del DPCM del 18 ottobre 2020 relativo all''emergenza COVID, il Comune\n  sta valutando possibili modalit di attuazione)\\u003c/li\\u003e\\u003cli\\u003evengono\n  organizzati\\u0026nbsp;\\u003ca href=\\"https://partecipazione.comune.milano.it/processes/piano-aria-clima/f/17/\\"\n  rel=\\"noopener noreferrer\\" target=\\"_blank\\"\\u003enove Incontri territoriali\\u0026nbsp;\\u003c/a\\u003epubblici\n  nei Municipi (on-line)\\u003c/li\\u003e\\u003cli\\u003eIl Consiglio Comunale adotta\n  il Piano Aria e Clima\\u003c/li\\u003e\\u003cli\\u003eviene realizzata la\\u0026nbsp;presentazione\n  pubblica di osservazioni sulla piattaforma Milano Partecipa.\\u0026nbsp;La raccolta\n  delle osservazioni ha una durata di 45 giorni, dal 12 gennaio al 25 febbraio 2021.\\u003c/li\\u003e\\u003cli\\u003ei\n  Municipi possono inviare all''Amministrazione i propri contributi\\u003c/li\\u003e\\u003c/ul\\u003e\\u003cp\\u003e\\u003cbr\\u003e\\u003c/p\\u003e","en":""}'\nstart_date:\n- \n- 2022-04-01\nend_date:\n- \n- 2022-04-14\ndecidim_participatory_process_id:\n- \n- 3\ncreated_at:\n- \n- &1 2022-03-17 15:51:37.576959800 Z\nupdated_at:\n- \n- *1\nposition:\n- \n- 2\n
1900	Decidim::ParticipatoryProcessStep	6	create	gid://decidim-torino/Decidim::User/227	\N	2022-03-17 15:52:06.829909	---\nid:\n- \n- 6\ntitle:\n- \n- '{"it":"FASE 3 | CONTRO-DEDUZIONI E APPROVAZIONE IN CONSIGLIO COMUNALE","en":""}'\ndescription:\n- \n- '{"it":"\\u003cul\\u003e\\u003cli\\u003ei\\u0026nbsp;\\u003ca href=\\"https://partecipazione.comune.milano.it/uploads/decidim/attachment/file/379/DD-4062-2021-TESTO_ATTO.pdf\\"\n  rel=\\"noopener noreferrer\\" target=\\"_blank\\"\\u003econtributi elaborati durante\n  il Percorso di Partecipazione\\u003c/a\\u003e\\u0026nbsp;vengono trasmessi al Consiglio\n  Comunale\\u003c/li\\u003e\\u003cli\\u003eil Piano Aria e Clima viene discusso, emendato\n  e approvato in Consiglio Comunale\\u003c/li\\u003e\\u003cli\\u003evengono pubblicate\n  su Milano Partecipa le risposte (contro-deduzioni) alle osservazioni\\u003c/li\\u003e\\u003c/ul\\u003e\\u003cp\\u003e\\u003cbr\\u003e\\u003c/p\\u003e","en":""}'\nstart_date:\n- \n- 2022-04-15\nend_date:\n- \n- 2022-04-28\ndecidim_participatory_process_id:\n- \n- 3\ncreated_at:\n- \n- &1 2022-03-17 15:52:06.829909800 Z\nupdated_at:\n- \n- *1\nposition:\n- \n- 3\n
