1904	Decidim::ParticipatoryProcessStep	3	update	\N	{"id": 3, "title": {"en": "Introduction", "it": "OBIETTIVI E METODO"}, "active": true, "cta_path": "", "cta_text": {"en": "", "it": ""}, "end_date": "2022-03-17", "position": 0, "created_at": "2022-03-17T15:45:06.112Z", "start_date": "2022-03-01", "updated_at": "2022-03-17T15:50:28.780Z", "description": {"en": "", "it": "<p>Il Percorso di Partecipazione ha lobiettivo di discutere e perfezionare le proposte per il territorio contenute nel Piano Aria e Clima.</p><p>Il processo coinvolge cittadini, portatori dinteresse, organizzazioni della societ civile, ordini professionali e soggetti economici in previsione dellapprovazione finale del Piano Aria e Clima da parte del Consiglio Comunale e dell'attuazione effettiva delle azioni del Piano, prevista tra il 2021 e il 2030.</p>"}, "decidim_participatory_process_id": 3}	2022-03-17 15:58:42.024908	---\nactive:\n- true\n- false\nupdated_at:\n- 2022-03-17 15:50:28.780888000 Z\n- 2022-03-17 15:58:42.024908300 Z\n
